import { makeStyles } from '@mui/styles';

export default makeStyles((theme) => ({
  title: {
    fontFamily: 'Copperplate',
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: '24px',
    lineHeight: '25px',
  },
  subtitle: {
    fontFamily: 'Copperplate',
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: '12px',
    lineHeight: '12px',
  }
}))
